news-feed\items\httpsfeedqgisorg\entries\items\72\content="<p>The QGIS User Conference '24 is an international 2-day event on September 9 and 10, 2024 in Bratislava, Slovakia.&nbsp; There will be presentations and workshops to get your QGIS knowledge up to date. There will also be space for \"unconference\" type of meetings, where you can bring your own topics for discussions or workshops and find people who are interested.</p>"
