NewsFeed\httpsfeedqgisorg\68\content="<p>Pour compl&eacute;ter les propositions d&eacute;j&agrave; re&ccedil;ues, <strong>l'appel &agrave; proposition est prolong&eacute; jusqu'au 15 janvier</strong>.</p>\r\n<p>Animez un atelier sur un plugin, une fonctionnalit&eacute;, une th&eacute;matique... Les participants ne vous en voudront pas si vous n'avez pas les r&eacute;ponses &agrave; toutes leurs questions, alors n'h&eacute;sitez pas !</p>\r\n<p>Double cliquez ici.</p>"
